import React from 'react';
import ReactDom from 'react-dom';
import { BrowserRouter } from 'react-router-dom';


import './index.css';
import App from './App/App';

if (typeof window !== 'undefined') {
  ReactDom.render((
    <BrowserRouter>
        <App/>
    </BrowserRouter>
  ), document.getElementById('root'));
}
